import React, {Component} from 'react';

class ResultsTable extends Component {

    render() {
        const {artist, title, album} = this.props;
        return (
            <div>
                <thead>
                    <tr>
                    <th>#</th>
                    <th>Artiste</th>
                    <th>Titre</th>
                    <th>Album</th>
                    <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                    <th>1</th>
                    {artist}
                    {title}
                    {album}
                    <th><input type="submit" value="Voir"/></th>
                    </tr>
                </tbody>
            </div>
        )
    }
}

export default ResultsTable;
